import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Note a mudança aqui

import Login from './components/login';
import OrdemDeServico from './caminho/para/OrdemDeServico';

function App() {
   return (
    <Router>
      <div>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/ordem-servico" element={<OrdemDeServico />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
